import React from 'react';
import Bucket from "./pages/Bucket";
import Detl from "./pages/Detail";
import NoMatch from "./pages/NoMatch";
import {broswerRouter as Router, Switch, Route} from "react-router-dom";
import Nav from "./components.Nav";


function App() {
  return (
    <Router>
      <>
      <Nav />
      <Switch>
        <Route exact path = "/" component = {Bucket}></Route>
        <Route exact path = "/bucket" component = {Bucket}></Route>
        <Route exact path = "/bucket/:id" component = {Detail}></Route>
      </Switch>
      </>
    </Router>

  );
}

export default App;
